import React from "react";
import Card from "./Card";

function Team() {
  return (
    <div className="row">
      <div className=" col-md-4 col-lg-3">
        <Card />
      </div>
      <div className=" col-md-4 col-lg-3">
        <Card />
      </div>
      <div className=" col-md-4 col-lg-3">
        <Card />
      </div>
      <div className=" col-md-4 col-lg-3">
        <Card />
      </div>
    </div>
  );
}

export default Team;
